package com.backend.microservices.humanservice.controller;

import com.backend.microservices.humanservice.model.HumanModel;
import com.sun.net.httpserver.Headers;
import lombok.extern.slf4j.Slf4j;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.*;

import java.util.*;

@RestController
@RequestMapping(value = "/v1/human")
@Slf4j
public class HumanController {

    @GetMapping("")
    public ResponseEntity<List<HumanModel>> getAllHuman() {
        List<HumanModel> lists = new ArrayList<>();
        for (int i = 0; i < 10; i++) {
            HumanModel human = getHumanModel();
            lists.add(human);
        }
        return new ResponseEntity<>(lists, HttpStatus.OK);
    }

    @GetMapping("/{id}")
    public ResponseEntity<HumanModel> findById(@RequestHeader Headers header, @PathVariable String id) {
        HumanModel human = getHumanModel();
        return new ResponseEntity<>(human, HttpStatus.OK);
    }

    @PostMapping("")
    public ResponseEntity<HumanModel> insertHuman(@RequestHeader Headers header, @RequestBody HumanModel humanModel) {
        HumanModel human = getHumanModel();
        return new ResponseEntity<>(human, HttpStatus.OK);
    }

    private HumanModel getHumanModel() {
        HumanModel human = new HumanModel();
        human.setId(1);
        human.setIdCard(getIdCard());
        human.setThaiTitle("setThaiTitle");
        human.setThaiLastName("setThaiLastName");
        human.setThaiLastName("setThaiLastName");
        human.setEnglishTitle("setEnglishTitle");
        human.setEnglishFirstName("setEnglishFirstName");
        human.setEnglishLastName("setEnglishLastName");
        Calendar c = Calendar.getInstance(Locale.ENGLISH);
        c.set(Calendar.YEAR, new Random().nextInt(1900, 2024));
        human.setDateOfBirth(c.getTime());
        human.setAddress("9 Ratchadapisek Rd., Jatujak Bangkok 10900 Thailand");
        human.setEmail(human.getEnglishFirstName() + "@microservices.com");
        human.setPhone("0900000000");
        human.setProfileImageId(1);
//        human.setProfile(getBase64Profile());
        return human;
    }

    private String getBase64Profile() {
        List<String> profiles = new ArrayList<>();
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        profiles.add("data:image/png;base64,");
        return profiles.get(new Random().nextInt(0, profiles.size()));
    }

    private String getIdCard() {
        Random r = new Random();
        String first = String.valueOf(r.nextInt(1, 9));
        String second = String.valueOf(r.nextInt(10, 99));
        String third = String.valueOf(r.nextInt(10, 99));
        String fourth = String.valueOf(r.nextInt(10000, 99999));
        String five = String.valueOf(r.nextInt(10, 99));
        var idCard = first + second + third + fourth + five;
        int length = 13;
        int total = 0;
        for (int i = 0; i < idCard.length(); i++) {
            total += (i * length);
            length--;
        }
        int total2 = total % 11;
        total2 = 11 - total2;
        return idCard + String.valueOf(total2).substring(String.valueOf(total2).length() - 1);
    }
}
